import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Signup from "./Components/Auth/Signup";
import Login from "./Components/Auth/Login";
import LandingPage from "./Components/LandingPage"; // Assuming you have a LandingPage component
import AddCollaborators from "./Components/AddCollaborators";
import Dashboard from "./Components/Dashboard";
import Themes from "./Components/Themes";
import ThemeSelector from "./Components/ThemeSelector"; // Import the ThemeSelector component

function App() {
  return (
    <Router>
      <div>
        {/* Navigation Bar */}
        <nav style={styles.nav}>
          <ul style={styles.navList}>
            <li style={styles.navItem}>
              <Link to="/" style={styles.navLink}>Home</Link>
            </li>
            <li style={styles.navItem}>
              <Link to="/signup" style={styles.navLink}>Sign Up</Link>
            </li>
            <li style={styles.navItem}>
              <Link to="/login" style={styles.navLink}>Login</Link>
            </li>
            <li style={styles.navItem}>
              <Link to="/add-collaborators" style={styles.navLink}>Add Collaborators</Link>
            </li>
            <li style={styles.navItem}>
              <Link to="/dashboard" style={styles.navLink}>Dashboard</Link>
            </li>
            <li style={styles.navItem}>
              <Link to="/themes" style={styles.navLink}>Themes</Link>
            </li>
            <li style={styles.navItem}>
              <Link to="/theme-selector" style={styles.navLink}>Theme Selector</Link> {/* Add the new route */}
            </li>
          </ul>
        </nav>

        {/* Routes */}
        <Routes>
          <Route path="/" element={<LandingPage />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/login" element={<Login />} />
          <Route path="/add-collaborators" element={<AddCollaborators />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/themes" element={<Themes />} />
          <Route path="/theme-selector" element={<ThemeSelector />} /> {/* Add the route for ThemeSelector */}
        </Routes>
      </div>
    </Router>
  );
}



export default App;
